import React, { useState } from "react";
import { Line } from "react-chartjs-2";
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
} from "chart.js";
import "./Statistics.css";

// Chart.js 기본 설정 등록
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

function Statistics() {
    const [selectedTab, setSelectedTab] = useState("week"); // 주/달/연도 탭
    const [selectedDate, setSelectedDate] = useState("2024.11.18~2024.11.24"); // 기본 날짜 선택
    const [averageTemp, setAverageTemp] = useState("25.6°C"); // 온도 데이터

    const handleTabClick = (tab) => {
        setSelectedTab(tab);
    };

    const handleDateChange = (event) => {
        setSelectedDate(event.target.value); // 모의로 날짜 변경 가능
    };

    // Mock 데이터 (주, 달, 연도별 그래프 데이터)
    const data = {
        week: {
            labels: ["월", "화", "수", "목", "금", "토", "일"],
            datasets: [
                {
                    label: "온도 변화 (°C)",
                    data: [22, 24, 25, 23, 26, 28, 25],
                    borderColor: "#FFA726",
                    backgroundColor: "rgba(255, 167, 38, 0.2)",
                    tension: 0.4,
                },
            ],
        },
        month: {
            labels: Array.from({ length: 30 }, (_, i) => `${i + 1}일`),
            datasets: [
                {
                    label: "온도 변화 (°C)",
                    data: Array.from({ length: 30 }, () => Math.floor(Math.random() * 10) + 20),
                    borderColor: "#42A5F5",
                    backgroundColor: "rgba(66, 165, 245, 0.2)",
                    tension: 0.4,
                },
            ],
        },
        year: {
            labels: ["1월", "2월", "3월", "4월", "5월", "6월", "7월", "8월", "9월", "10월", "11월", "12월"],
            datasets: [
                {
                    label: "온도 변화 (°C)",
                    data: Array.from({ length: 12 }, () => Math.floor(Math.random() * 15) + 15),
                    borderColor: "#66BB6A",
                    backgroundColor: "rgba(102, 187, 106, 0.2)",
                    tension: 0.4,
                },
            ],
        },
    };

    // 현재 선택된 탭의 데이터를 가져옴
    const chartData = data[selectedTab];

    return (
        <div className="statistics-container">
            <header className="statistics-header">
                <h1>나의 온도 평균</h1>
                <p>내가 그동안 기록해왔던 지난 날을 살펴봐요.</p>
            </header>

            <div className="tabs">
                <button
                    className={`tab-button ${selectedTab === "week" ? "active" : ""}`}
                    onClick={() => handleTabClick("week")}
                >
                    주
                </button>
                <button
                    className={`tab-button ${selectedTab === "month" ? "active" : ""}`}
                    onClick={() => handleTabClick("month")}
                >
                    달
                </button>
                <button
                    className={`tab-button ${selectedTab === "year" ? "active" : ""}`}
                    onClick={() => handleTabClick("year")}
                >
                    연도
                </button>
            </div>

            <div className="date-selector">
                <label htmlFor="date">날짜 선택:</label>
                <select id="date" value={selectedDate} onChange={handleDateChange}>
                    <option value="2024.11.18~2024.11.24">2024.11.18~2024.11.24</option>
                    <option value="2024.11.11~2024.11.17">2024.11.11~2024.11.17</option>
                </select>
            </div>

            <div className="chart-section">
                <Line
                    data={chartData}
                    options={{
                        responsive: true,
                        plugins: {
                            legend: {
                                display: true,
                                position: "top",
                            },
                            title: {
                                display: true,
                                text: `${selectedTab === "week" ? "주간" : selectedTab === "month" ? "월간" : "연간"} 온도 변화`,
                            },
                        },
                    }}
                />
            </div>

            <div className="average-temp">
                <p>{selectedDate}의</p>
                <p>평균 온도는 <strong>{averageTemp}</strong> 입니다.</p>
            </div>
        </div>
    );
}

export default Statistics;
